<script type="text/javascript" src="jspdf.min.js"></script>

<script type="text/javascript" src="jspdf.plugin.autotable"></script>

<script>
  
document.getElementById('imprimirInsumos').addEventListener("click", imprimirInsumos)

var imgDataStockInsumos='data:image/png;base64,'

function  imprimirInsumos(){


      var diaimpresion=new Date().toLocaleDateString('es-AR');

      var horaimpresion=new Date().toLocaleTimeString('es-AR');

      var tablaaimprimir=$("#tablastockinsumo").clone();
          tablaaimprimir.find(".columnaboton").remove();


 var doc = new jsPDF();
   

var tablajson=doc.autoTableHtmlToJson(tablaaimprimir.get(0))

doc.autoTable(tablajson.columns, tablajson.data,{startY:50, margin: {top: 50, right: 30, bottom: 20, left: 30},headStyles :{fontSize:10,cellPadding:1,halign:'center',valign:'middle',fillColor:0},bodyStyles:{fontSize:10,cellPadding:1,halign:'center',valign:'middle'}})



const pages = doc.internal.getNumberOfPages();
const pageWidth = doc.internal.pageSize.width;  //Optional
const pageHeight = doc.internal.pageSize.height;  //Optional
doc.setFontSize(10);  //Optional
        
for (let j = 1; j < pages + 1 ; j++) {
      let horizontalPos = pageWidth - 25;  //Can be fixed number
      let verticalPos = pageHeight - 272;  //Can be fixed number
      doc.setPage(j);
      doc.text(`${j} de ${pages}`, horizontalPos, verticalPos)
      doc.setFontSize(10).text(183,13,diaimpresion);
      doc.setFontSize(10).text(183,19,horaimpresion);
doc.addImage(imgDataStockInsumos,'PNG',0,0,210,297);

}

var nombrepdf="Gesti√≥n PURARES Stock de Insumos al "+diaimpresion;

doc.save(nombrepdf)

}

</script> 

